import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }


    componentDidMount()
    {
        var buffer;
        var arr;
        fetch(raw)
            .then(r => r.text())
            .then(text => {
                buffer = text;
                console.log('buffer is ', buffer);
                arr = buffer.split('\n');
                console.log('array is', arr);
                this.setState({ buffer });
            });
        

    }

    render()
    {
        return (

            <ul>
                {
                    this.state.listings
                        .map((listing, index) =>
                            <li key={index}>
                                { listing }
                            </li>
                        )
                }
            </ul>
        );
    }


}
